import React from 'react';
import Menu from '../Menu/Menu'
import menu_data from './/navdata'

export default class Header extends React.Component{
render () {
  return (
      <header>
        <div className="wrapper">
		  <ul><Menu menu={menu_data} /></ul>
        </div>
        </header>
  )
}
}
